INSERT INTO `v1_416c5c6fedf2946956f7accf6eee1f458b75c8b46e17d3236b5cf92d07a10579` VALUES (11, 0, 1, 4, 1, 0, 111011, "", 1110501, 1110501043, "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！");
INSERT INTO `v1_416c5c6fedf2946956f7accf6eee1f458b75c8b46e17d3236b5cf92d07a10579` VALUES (91, "", "", "", "", "", 0, "", 1110501, 1110501044, "");
