INSERT INTO `v1_416c5c6fedf2946956f7accf6eee1f458b75c8b46e17d3236b5cf92d07a10579` VALUES (11, 0, 1, 4, 1, 0, 111011, "", 1110501, 1110501046, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……");
INSERT INTO `v1_416c5c6fedf2946956f7accf6eee1f458b75c8b46e17d3236b5cf92d07a10579` VALUES (91, "", "", "", "", "", 0, "", 1110501, 1110501047, "");
